import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { Card, CardContent, Typography } from '@mui/material';

const TreasuryData = () => {
  const [yieldData, setYieldData] = useState(null);

  useEffect(() => {
    const fetchData = async () => {
      const apiKey = 'YOUR_API_KEY'; // Replace with your actual API key
      const url = `https://www.alphavantage.co/query?function=TREASURY_YIELD&interval=monthly&maturity=10year&apikey=${apiKey}`;
      
      try {
        const response = await axios.get(url);
        setYieldData(response.data);
      } catch (error) {
        console.error('Error fetching data from Alpha Vantage:', error);
      }
    };

    fetchData();
  }, []);

  return (
    <Card>
      <CardContent>
        <Typography variant="h5" gutterBottom>
          U.S. Treasury Yield Data
        </Typography>
        {yieldData ? (
          <Typography variant="body2">
            {JSON.stringify(yieldData)}
          </Typography>
        ) : (
          <Typography variant="body2">
            Loading data...
          </Typography>
        )}
      </CardContent>
    </Card>
  );
};

export default TreasuryData;
